const Header = () => {
  return (
    <div className="header-container">
      <div className="nav-container">
        <div className="wrapper logo">lOGO</div>
        <div className="wrapper navlinks-center">
          <ul>
            <li>Products</li>
          </ul>
        </div>
        <div className="wrapper navlinks-right" />
      </div>
      <style jsx>
        {`
        .nav-container{
            display: grid;
            grid-template-columns: repeat(3, 1fr);
            grid-gap: 5px;
        }
        .wrapper {
            background-color:pink;
        }
        .header-container {
            width:100vw;
            height:100px;
            background-color: white;
            padding: 2vh 2vh;
        `}
      </style>
    </div>
  );
};

export default Header;
